import React, { useEffect } from "react";
import { Form } from "react-bootstrap";
import { useSelector, useDispatch } from "react-redux";
import { FormInput } from "src/Components/UI/Input/FormInput";
import { getModalData } from "src/store/product-slice";
const ModalContentBody = () => {
  const mapStateToProps = (state) => {
    return {
      id: state.productStore.modalData.productId,
      isLoading: state.productStore.isLoading,
      modalActionData:modalActionData
    };
  };
  const state = useSelector(mapStateToProps);
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getModalData(state.id));
  }, [dispatch]);

  const onSubmitHandler = (event) =>{
      event.preventDefault();
  }
  return (
    <Form onSubmit={onSubmitHandler}>
      <FormInput
        type="text"
        readOnly={true}
        value={"name"}
        label="Product Name"
      />
    </Form>
  );
};
export default ModalContentBody;
